import { SocialIcon } from 'react-social-icons';

import './Footer.css'

export default function Footer() {
  return (
    <div id='footer'>
        <div id='mediaLinks'>
            <SocialIcon url='github.com/Plezo'/>
            <SocialIcon url='linkedin.com/in/plezo'/>
        </div>
        <p>
          2022 Patryk Lezon. All rights reserved.
        </p>
      </div>
  )
}
